import { View, Text, StyleSheet } from "react-native";
import React, { useState, useEffect } from "react";
import {
  TextInput,
  Button,
  Snackbar,
  HelperText,
  List,
} from "react-native-paper";
import axios from "axios";
import MaterialServices from "../../../services/MaterialServices";

const PrestarMaterialScreen = ({ route, navigation }) => {
  const { detalleMaterial, ejemplares } = route.params;

  console.log(detalleMaterial);

  useEffect(() => {
    navigation.setOptions({
      title: detalleMaterial.titulo,
    });

  }, [detalleMaterial, ejemplares]);
  return (
    <View>
      <Text>PrestarMaterialScreen</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    padding: 16,
  },
  button: {
    marginTop: 16,
  },
  label: {
    fontSize: 16,
    marginBottom: 5,
  },
  input: {
    height: 40,
    borderColor: "gray",
    borderWidth: 1,
    marginBottom: 10,
    paddingHorizontal: 10,
  },
});

export default PrestarMaterialScreen;
